import React from "react";

function Row (props) {

    return (
          <div><img src={props.thumbnail}></img>
          <p>{props.first} {props.last}</p>
          <p>{props.cell}</p>
          <p>{props.email}</p>
          <p>{props.dob}</p>
          </div>
    );
}

export default Row;
